import React from "react";
import { 
    Container,
    Grid,
    Paper
 } from "@material-ui/core"

class GridLayout extends React.PureComponent {
    render() {
        return (
            <div className = "grid">
                <Grid container spacing = {3}
                    direction="row"
                    justify="flex-start"
                    alignItems="center">
                    <Grid item xs = {3} className = "box">
                        File Name
                    </Grid>
                    <Grid item xs = {3} className = "box">
                        File Name
                    </Grid>
                    <Grid item xs = {3} className = "box">
                        File Name
                    </Grid>
                    <Grid item xs = {3} className = "box">
                        File Name
                    </Grid>
                </Grid>
            </div>
        )
    }
}

export default GridLayout;
